script: |
  super -f text -I q8524.spq | sort > q8524.out

inputs:
  - name: q8524.spq
    data: |
      SELECT DISTINCT - col0 AS col1 FROM tab1 (FORMAT parquet) WHERE - 32 * - col0 NOT BETWEEN + col0 AND + col1;
  - name: tab1

outputs:
  - name: q8524.out
    data: |
      -51
      -85
      -91
